y=x(2:end);
xmp_2=ones(5,1);
xmp_1_b=y-b;
xmd_1=y.^2;
xmd_La=y.*xmd_1-x(1);
Q=a.*xmp_1_b.*xmd_La;
Q(6) = C*y-1;
DQ = zeros(6);
for ia=1:5
	DQ(ia, ia+1) = a(ia)*(1*xmp_2(ia)*xmd_La(ia)+3*xmp_1_b(ia)*xmd_1(ia));
end
